import React from "react";
import { Col, Container, Row } from "reactstrap";

const Firstpage = () => {
  return (
    <>
      <Container>
        <h1 className="mt-4">Welcome To University Of Mianwali</h1>
        <Row>
          <Col md= '6' lg='6'></Col>

        </Row>
      </Container>
    </>
  );
};

export default Firstpage;
